/*Table structure for table `gray_application` */

DROP TABLE IF EXISTS `gray_application`;

CREATE TABLE `gray_application` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `application_id` varchar(100) DEFAULT NULL COMMENT 'application_id',
  `gray_ip` varchar(100) DEFAULT NULL COMMENT '可以制定多台机器作为灰度机，多个机器用;区分，区间制定用-隔开',
  `deploy_ip` varchar(500) DEFAULT NULL COMMENT '线上部署应用的ip',
  `remark` varchar(200) DEFAULT NULL COMMENT '可以按照用户特征等将其分组',
  `status` int(11) DEFAULT NULL COMMENT '1开启，0关闭',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user` varchar(50) DEFAULT NULL COMMENT '修改人',
  `param` varchar(100) DEFAULT NULL COMMENT '灰度参数',
  `organization_id` int(11) DEFAULT NULL COMMENT '部门id',
  PRIMARY KEY (`id`),
  UNIQUE KEY `system_id` (`application_id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='被灰度系统管理';

