/*Table structure for table `gray_application_business` */

DROP TABLE IF EXISTS `gray_application_business`;

CREATE TABLE `gray_application_business` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `type` varchar(10) DEFAULT NULL COMMENT 'http，dubbo,threft',
  `version` varchar(100) DEFAULT NULL COMMENT 'version',
  `remark` varchar(200) DEFAULT NULL COMMENT '可以按照用户特征等将其分组',
  `status` int(11) DEFAULT NULL COMMENT '1可用，0不可用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user` varchar(50) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='dubbo服务对应的consumer的系统，按照业务线\n';

