/*Table structure for table `gray_application_instance` */

DROP TABLE IF EXISTS `gray_application_instance`;

CREATE TABLE `gray_application_instance` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `application_id` varchar(100) DEFAULT NULL COMMENT 'application_id',
  `type` varchar(30) DEFAULT NULL COMMENT '类型',
  `gray_instance` varchar(100) DEFAULT NULL COMMENT '可以制定多台机器作为灰度机，多个机器用;区分，区间制定用-隔开',
  `deploy_instance` varchar(500) DEFAULT NULL COMMENT '线上部署应用的ip',
  `remark` varchar(200) DEFAULT NULL COMMENT '可以按照用户特征等将其分组',
  `status` int(11) DEFAULT NULL COMMENT '1正常，0停用',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user` varchar(50) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`id`),
  UNIQUE KEY `system_id` (`application_id`,`type`),
  UNIQUE KEY `application_id` (`application_id`,`type`)
